import "./App.css";
import { BrowserRouter, Router, Route } from "react-router-dom";
import Navbar from "./components/Navbar";


function App() {
  return (
    <BrowserRouter>
    <Navbar/>
    <Router>
      <Route path="/"  exact />
      <Route path=""  />
      <Route path=""  />
    </Router>
    </BrowserRouter>
  );
}

export default App;
